        const uniqueMonths = ["2025-06", "2025-07", "2025-08", "2025-09", "2025-10", "2025-11", "2025-12", "2026-01", "2026-02", "2026-03", "2026-04", "2026-05", "2026-06", "2026-07", "2026-08", "2026-09", "2026-10", "2026-11", "2026-12"];
        console.log('Datos cargados:', data.length, 'registros');
        console.log('Meses únicos:', uniqueMonths);

        // Inicializar mapa
        function initMap() {
            map = L.map('map').setView([40.7128, -74.0060], 12);
            L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a>'
            }).addTo(map);
            markersLayer = L.layerGroup().addTo(map);
            console.log('Mapa inicializado');
        }

        // Actualizar marcadores
        function updateMarkers() {
            const month = document.getElementById('month-select').value;
            const hour = parseInt(document.getElementById('hour-slider').value);
            document.getElementById('hour-label').textContent = `${hour}:00`;
            console.log('Actualizando marcadores para mes:', month, 'hora:', hour);

            markersLayer.clearLayers();
            const filteredData = data.filter(row => row.MES_ANO === month && row.HORA === hour);
            console.log('Datos filtrados:', filteredData.length, 'registros');

            if (!filteredData.length) {
                document.getElementById('error').textContent = 'No hay datos para el mes y hora seleccionados.';
                document.getElementById('error').classList.remove('hidden');
                return;
            } else {
                document.getElementById('error').classList.add('hidden');
            }

            filteredData.forEach(row => {
                const radius = Math.max(row.BICICLETAS_NECESARIAS * 2, 5);
                const marker = L.circleMarker([row.LATITUD, row.LONGITUD], {
                    radius: radius,
                    color: 'darkblue',
                    fillColor: 'blue',
                    fillOpacity: 0.6
                }).addTo(markersLayer);
                marker.bindPopup(
                    `<b>${row.NOMBRE_ESTACION}</b><br>Demanda: ${row.BICICLETAS_NECESARIAS} bicis`
                );
            });
        }

        // Configurar eventos
        function setupEvents() {
            document.getElementById('month-select').addEventListener('change', updateMarkers);
            document.getElementById('hour-slider').addEventListener('input', updateMarkers);
            console.log('Eventos configurados');
        }

        // Iniciar aplicación
        try {
            initMap();
            setupEvents();
            updateMarkers();
        } catch (e) {
            console.error('Error al iniciar:', e);
            document.getElementById('app').innerHTML += '<p class="text-center text-red-600">Error al cargar el mapa. Revisa la consola.</p>';
        }
    </script>
